INSERT INTO `wp_posts` VALUES (1,1,'2019-04-04 14:51:39','2019-04-04 12:51:39','<!-- wp:paragraph -->\n<p>\n\nLa compagnie allemande Lufthansa ouvrira une nouvelle liaison aérienne entre Strasbourg et Munich à partir du 9 avril prochain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans un premier temps, la desserte s\'élèvera à cinq allers-retours par semaine (un par jour sauf le week-end). L\'avion sera un Bombardier CRJ900 de 90 sièges et les vols dureront 55 minutes. Lufthansa annonce des allers-retours à 99 euros et des allers simples à 79 euros (prix les plus bas).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Il y a trois ans, le groupe de contact mis en place par le Parlement, la Ville et l\'Eurométropole a fait état de difficultés pour les députés des pays de l\'Est de se rendre à Strasbourg, explique le directeur de l\'aéroport Thomas Dubus. Si les horaires de vols sont calés en fonction des obligations diplomatiques, l\'offre commerciale s\'adresse à tout le monde.\" Strasbourg possède 52 liaisons directes, la desserte de Munich remplaçant celle de Prague dont l\'activité fléchissait depuis quelques années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avec 140 destinations dans 46 pays (Europe, Amérique, Asie, Moyen Orient et Afrique), la capitale bavaroise est la deuxième plate-forme de correspondance de Lufthansa (après Francfort), avec un taux de croissance annuel de 5 % à 10 %.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"La liaison vers Munich existait entre 2005 et 2007 mais il y avait alors beaucoup moins de destinations en correspondance, assure Michael Gloor, directeur de Lufthansa France. Nous espérons que cela aura un impact sur le tourisme en Alsace. En tant que capitale européenne, Strasbourg dispose d\'une forte notoriété auprès des Allemands.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>L\'engagement entre l\'aéroport de Strasbourg et la compagnie allemande s\'établit sur une durée de trois ans. \"La desserte hebdomadaire augmentera au fur et à mesure, passant à 6 puis 7 allers-retours\", révèle Thomas Dubus.</p>\n<!-- /wp:paragraph -->','LA BAVIÈRE PAR LES AIRS','','publish','closed','closed','','bonjour-tout-le-monde','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=1',0,'post','',0),(2,1,'2019-04-04 14:51:39','2019-04-04 12:51:39','','Accueil','','publish','closed','open','','page-d-exemple','','','2019-04-24 09:55:28','2019-04-24 07:55:28','',0,'http://localhost/P2v2.2/?page_id=2',0,'page','',0),(3,1,'2019-04-04 14:51:39','2019-04-04 12:51:39','<!-- wp:heading --><h2>Qui sommes-nous ?</h2><!-- /wp:heading --><!-- wp:paragraph --><p>L’adresse de notre site Web est : http://localhost/P2v2.2.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Utilisation des données personnelles collectées</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Commentaires</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Quand vous laissez un commentaire sur notre site web, les données inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et l’agent utilisateur de votre navigateur sont collectés pour nous aider à la détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Une chaîne anonymisée créée à partir de votre adresse de messagerie (également appelée hash) peut être envoyée au service Gravatar pour vérifier si vous utilisez ce dernier. Les clauses de confidentialité du service Gravatar sont disponibles ici : https://automattic.com/privacy/. Après validation de votre commentaire, votre photo de profil sera visible publiquement à coté de votre commentaire.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Médias</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous êtes un utilisateur ou une utilisatrice enregistré·e et que vous téléversez des images sur le site web, nous vous conseillons d’éviter de téléverser des images contenant des données EXIF de coordonnées GPS. Les visiteurs de votre site web peuvent télécharger et extraire des données de localisation depuis ces images.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulaires de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous déposez un commentaire sur notre site, il vous sera proposé d’enregistrer votre nom, adresse de messagerie et site web dans des cookies. C’est uniquement pour votre confort afin de ne pas avoir à saisir ces informations si vous déposez un autre commentaire plus tard. Ces cookies expirent au bout d’un an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si vous avez un compte et que vous vous connectez sur ce site, un cookie temporaire sera créé afin de déterminer si votre navigateur accepte les cookies. Il ne contient pas de données personnelles et sera supprimé automatiquement à la fermeture de votre navigateur.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos préférences d’écran. La durée de vie d’un cookie de connexion est de deux jours, celle d’un cookie d’option d’écran est d’un an. Si vous cochez « Se souvenir de moi », votre cookie de connexion sera conservé pendant deux semaines. Si vous vous déconnectez de votre compte, le cookie de connexion sera effacé.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En modifiant ou en publiant une publication, un cookie supplémentaire sera enregistré dans votre navigateur. Ce cookie ne comprend aucune donnée personnelle. Il indique simplement l’ID de la publication que vous venez de modifier. Il expire au bout d’un jour.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenu embarqué depuis d’autres sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Les articles de ce site peuvent inclure des contenus intégrés (par exemple des vidéos, images, articles…). Le contenu intégré depuis d’autres sites se comporte de la même manière que si le visiteur se rendait sur cet autre site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Ces sites web pourraient collecter des données sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqués si vous disposez d’un compte connecté sur leur site web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Statistiques et mesures d’audience</h3><!-- /wp:heading --><!-- wp:heading --><h2>Utilisation et transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:heading --><h2>Durées de stockage de vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous laissez un commentaire, le commentaire et ses métadonnées sont conservés indéfiniment. Cela permet de reconnaître et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modération.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pour les utilisateurs et utilisatrices qui s’enregistrent sur notre site (si cela est possible), nous stockons également les données personnelles indiquées dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles à tout moment (à l’exception de leur nom d’utilisateur·ice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Les droits que vous avez sur vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous avez un compte ou si vous avez laissé des commentaires sur le site, vous pouvez demander à recevoir un fichier contenant toutes les données personnelles que nous possédons à votre sujet, incluant celles que vous nous avez fournies. Vous pouvez également demander la suppression des données personnelles vous concernant. Cela ne prend pas en compte les données stockées à des fins administratives, légales ou pour des raisons de sécurité.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Les commentaires des visiteurs peuvent être vérifiés à l’aide d’un service automatisé de détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informations de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informations supplémentaires</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comment nous protégeons vos données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Procédures mises en œuvre en cas de fuite de données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Les services tiers qui nous transmettent des données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Opérations de marketing automatisé et/ou de profilage réalisées à l’aide des données personnelles</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Affichage des informations liées aux secteurs soumis à des régulations spécifiques</h3><!-- /wp:heading -->','Politique de confidentialité','','draft','closed','open','','politique-de-confidentialite','','','2019-04-04 14:51:39','2019-04-04 12:51:39','',0,'http://localhost/P2v2.2/?page_id=3',0,'page','',0),(5,1,'2019-04-04 14:54:13','2019-04-04 12:54:13','<!-- wp:paragraph -->\n<p>Ceci est une page d’exemple. C’est différent d’un article de blog parce qu’elle restera au même endroit et apparaîtra dans la navigation de votre site (dans la plupart des thèmes). La plupart des gens commencent par une page «&nbsp;À propos&nbsp;» qui les présente aux visiteurs du site. Cela pourrait ressembler à quelque chose comme cela&nbsp;:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Bonjour&nbsp;! Je suis un mécanicien qui aspire à devenir acteur, et voici mon site. J’habite à Bordeaux, j’ai un super chien baptisé Russell, et j’aime la vodka-ananas (ainsi qu’être surpris par la pluie soudaine lors de longues balades sur la plage au coucher du soleil).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>... ou quelque chose comme cela&nbsp;:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis lors. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>En tant que nouvel·le utilisateur ou utilisatrice de WordPress, vous devriez vous rendre sur <a href=\"http://localhost/P2v2.2/wp-admin/\">votre tableau de bord</a> pour supprimer cette page et créer de nouvelles pages pour votre contenu. Amusez-vous bien&nbsp;!</p>\n<!-- /wp:paragraph -->','Accueil','','inherit','closed','closed','','2-revision-v1','','','2019-04-04 14:54:13','2019-04-04 12:54:13','',2,'http://localhost/P2v2.2/2019/04/04/2-revision-v1/',0,'revision','',0),(6,1,'2019-04-04 14:54:27','2019-04-04 12:54:27','','Plus d\'infos','','publish','closed','closed','','plus-dinfos','','','2019-04-08 14:32:14','2019-04-08 12:32:14','',0,'http://localhost/P2v2.2/?page_id=6',0,'page','',0),(7,1,'2019-04-04 14:54:27','2019-04-04 12:54:27','','Plus d\'infos','','inherit','closed','closed','','6-revision-v1','','','2019-04-04 14:54:27','2019-04-04 12:54:27','',6,'http://localhost/P2v2.2/2019/04/04/6-revision-v1/',0,'revision','',0),(8,1,'2019-04-04 14:54:41','2019-04-04 12:54:41','','Actualités','','publish','closed','closed','','actualites','','','2019-04-08 13:06:14','2019-04-08 11:06:14','',0,'http://localhost/P2v2.2/?page_id=8',0,'page','',0),(9,1,'2019-04-04 14:54:41','2019-04-04 12:54:41','','Actualités','','inherit','closed','closed','','8-revision-v1','','','2019-04-04 14:54:41','2019-04-04 12:54:41','',8,'http://localhost/P2v2.2/