 qu’y occupe l’Alsace de par son histoire sont autant de sujets abordés par l’artiste, qui n’hésitait pas, dans ses œuvres, à dénoncer la violence et le totalitarisme, mais aussi les faiblesses de l’Europe. </p>\n<!-- /wp:paragraph -->','Tomi Ungerer l\'Européen','','publish','closed','open','','tomi-ungerer-leuropeen','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=31',0,'post','',0),(32,1,'2019-04-04 15:08:09','2019-04-04 13:08:09','Tomi Ungerer, Cultive tes racines, M. Bernhardt.','Tomi Ungerer, Cultive tes racines, M. Bernhardt.','Tomi Ungerer, Cultive tes racines, M. Bernhardt.','inherit','open','closed','','223013186_1','','','2019-04-04 15:10:21','2019-04-04 13:10:21','',31,'http://localhost/P2v2.2/wp-content/uploads/2019/04/223013186_1.jpg',0,'attachment','image/jpeg',0),(33,1,'2019-04-04 15:10:07','2019-04-04 13:10:07','<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\"> Strasbourgeois de naissance, l’artiste récemment disparu Tomi Ungerer était très attaché à l’idée de l’Europe et aux valeurs de justice, de tolérance et d’humanisme qu’elle véhicule. Les relations franco-allemandes, la construction européenne, la place particulière qu’y occupe l’Alsace de par son histoire sont autant de sujets abordés par l’artiste, qui n’hésitait pas, dans ses œuvres, à dénoncer la violence et le totalitarisme, mais aussi les faiblesses de l’Europe. </p>\n<!-- /wp:paragraph -->','Tomi Ungerer l\'Européen','','inherit','closed','closed','','31-revision-v1','','','2019-04-04 15:10:07','2019-04-04 13:10:07','',31,'http://localhost/P2v2.2/2019/04/04/31-revision-v1/',0,'revision','',0),(36,0,'2019-04-04 15:23:17','2019-04-04 13:23:17','<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\">Le Musée Alsacien propose au visiteur un parcours plein de charme à travers d’anciennes demeures strasbourgeoises reliées par des escaliers et des coursives en bois. Il présente&nbsp;<strong>des milliers d’objets témoins de la vie rurale en Alsace aux XVIII<sup>e</sup>&nbsp;et XIX<sup>e</sup>&nbsp;siècles</strong>&nbsp;: costumes, meubles, céramiques, jouets, imagerie religieuse et profane, etc. Des reconstitutions d’intérieurs caractéristiques de différents \"pays\" d’Alsace (plaine agricole, vignoble, montagne vosgienne) et d’ateliers d’artisans jalonnent la visite de ce musée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Plusieurs salles sont des répliques assez fidèles d’intérieurs ruraux, comme celle de la&nbsp;<em>Stùb</em>&nbsp;(pièce commune) d’une ferme de Wintzenheim, d’autres plus imaginaires comme celle de la cuisine et surtout l’atelier de pharmacien-alchimiste.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le visiteur circule parmi toutes les pièces qui constituent le Musée Alsacien comme il se promènerait dans une maison dont les habitants viendraient tout juste de s’absenter. Les planchers qui craquent, les meubles garnissant toutes les pièces et tous ces objets, dont aucun n’est anodin, évoquent une vie à la fois familière et si différente de celle d’aujourd’hui.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour redonner un second souffle aux collections, le Musée Alsacien organise toujours de&nbsp;<strong>nombreux évènements et expositions</strong>&nbsp;qui mettent en lumière son souci constant de lier passé et présent, tradition et modernité.</p>\n<!-- /wp:paragraph -->','Musée Alsacien','','publish','closed','closed','','musee-alsacien','','','2019-04-15 19:19:34','2019-04-15 17:19:34','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=36',0,'culture','',0),(37,0,'2019-04-04 15:35:58','2019-04-04 13:35:58','<!-- wp:paragraph -->\n<p>Les inscriptions sont ouvertes !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\">Premier grand rendez-vous de l’année pour l’Association des Courses de Strasbourg Europe et l’Office des Sports de Strasbourg, les Courses de Strasbourg Europe 2019 auront lieu les 10,11 et 12 mai 2019.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les inscriptions pour cette 40e édition sont ouvertes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>CÔTÉ COURSES</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li><strong>12 000 participants attendus</strong></li><li><strong>8 épreuves :</strong></li></ol>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Course : 5km / 10km / semi-marathon</li><li>Marche : marche nordique compétition / marche nature loisir / marche de l’Europe</li><li>Roller : balade roller 10km</li><li>Challenges : challenge ACSE (5km + 10km + semi-marathon) et challenges du nombre Crédit Mutuel</li><li>Dans les bureaux de l\'Office des Sports de Strasbourg au 19, rue des Couples&nbsp;<strong>jusqu’au 9 mai</strong></li><li>Sur le village des courses&nbsp;<strong>jusqu’au 11 mai 19h00&nbsp;</strong>(aucune inscription possible le dimanche 12 mai)</li></ul>\n<!-- /wp:list -->','Courses de Strasbourg','','publish','closed','closed','','courses-de-strasbourg','','','2019-04-15 19:16:46','2019-04-15 17:16:46','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=37',0,'sport','',0),(38,1,'2019-04-04 15:37:46','2019-04-04 13:37:46','','cour_mals_28-1038x535','','inherit','open','closed','','cour_mals_28-1038x535','','','2019-04-04 15:37:46','2019-04-04 13:37:46','',36,'http://localhost/P2v2.2/wp-content/uploads/2019/04/cour_mals_28-1038x535.jpg',0,'attachment','image/jpeg',0),(39,1,'2019-04-04 15:38:04','2019-04-04 13:38:04','','courses_strasbourg_inscription','','inherit','open','closed','','courses_strasbourg_inscription','','','2019-04-04 15:38:04','2019-04-04 13:38:04','',37,'http://localhost/P2v2.2/wp-content/uploads/2019/04/courses_strasbourg_inscription.jpg',0,'attachment','image/jpeg',0),(40,0,'2019-04-04 15:39:07','2019-04-04 13:39:07','<!-- wp:paragraph -->\n<p>Vouée au culte protestant, l’église Saint-Thomas est un très bel exemple de l’art gothique alsacien. Son choeur abrite l’impressionnant mausolée du Maréchal de Saxe : un chef d’œuvre de l’art funéraire baroque du XVIIIe siècle.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Visites guidées en français ou allemand sur demande préalable au tél. 03 88 32 14 46.<br>Le dimanche matin est réservé aux offices.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Accessible aux personnes à mobilité réduite sur demande préalable.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-------------</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le \"Chemin d’églises ouvertes\" est un projet commun des paroisses Temple Neuf, Saint-Pierre-le-Jeune et Saint-Thomas, au sein de la Communion protestante Strasbourg-Centre (Union des Eglises protestantes d\'Alsace et de Lorraine). Il vise à ouvrir l\'église aux passants tout en mettant des projets en place au sein des églises pour ainsi les inciter à en franchir le seuil.</p>\n<!-- /wp:paragraph -->','L\'Eglise Saint-Thomas','','publish','closed','closed','','leglise-saint-thomas','','','2019-04-15 19:19:10','2019-04-15 17:19:10','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=40',0,'culture','',0),(41,1,'2019-04-04 15:39:02','2019-04-04 13:39:02','','223005691_1 (1)','','inherit','open','closed','','223005691_1-1','','','2019-04-04 15:39:02','2019-04-04 13:39:02','',40,'http://localhost/P2v2.2/wp-content/uploads/2019/04/223005691_1-1.jpg',0,'attachment','image/jpeg',0),(43,1,'2019-04-04 15:46:31','2019-04-04 13:46:31','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:4:\"page\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";}','Image Header','image-header','publish','closed','closed','','group_5ca60a59b22ca','','','2019-04-04 15:55:17','2019-04-04 13:55:17','',0,'http://localh