/04/05/2-revision-v1/',0,'revision','',0),(65,1,'2019-04-08 13:05:53','2019-04-08 11:05:53','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:4:\"page\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:1:\"8\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";}','Page des Articles','page-des-articles','publish','closed','closed','','group_5cab2a4853ea0','','','2019-04-08 13:05:53','2019-04-08 11:05:53','',0,'http://localhost/P2v2.2/?post_type=acf-field-group&#038;p=65',0,'acf-field-group','',0),(66,1,'2019-04-08 13:05:53','2019-04-08 11:05:53','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:35:\"Phrase d\'annonce de la page de blog\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:57:\"Retrouvez ici toutes les news de l\'actualité de la ville\";s:11:\"placeholder\";s:57:\"Retrouvez ici toutes les news de l\'actualité de la ville\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";i:100;}','Annonce page de blog','annonce','publish','closed','closed','','field_5cab2a5ac8a94','','','2019-04-08 13:05:53','2019-04-08 11:05:53','',65,'http://localhost/P2v2.2/?post_type=acf-field&p=66',0,'acf-field','',0),(67,0,'2019-04-08 14:03:57','2019-04-08 12:03:57','<!-- wp:paragraph -->\n<p><strong>Description :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>L’atelier réalité: Scène Ouverte<br><br>OUVERT AUX DÉBUTANTS ET AUX PUBLICS !!!&nbsp;<br><br>C’est le mélange de trois disciplines socle de base du café-théâtre:&nbsp;<br><br>Des morceaux de spectacles seront écrits, scénarisés, appris par coeur et joués sur un plateau. Interprétés les uns après les autres, ces morceaux feront naître le cabaret de la maison Mimir.&nbsp;<br><br>18h30 Atelier d’écriture&nbsp;<br><br>Écrire un sketch, un texte, un poème, un rondeau, une chanson, un acte...&nbsp;<br>Quelque chose de textuel fait pour être joué sur scène&nbsp;<br><br>Autour d’un thème, les participants seront invités à imaginer la plus belle histoire qu’ils voudraient donner à l’auditoire.&nbsp;<br><br>20h30 Théâtre d’Impro&nbsp;<br><br>Rien de tel qu’un atelier d’impro pour se saisir de son jeu d’acteur ou de comédien... Ou des deux...&nbsp;<br><br>Les méninges en feu, les jambes en coton, l’audace d’une répartie venue de nulle part... L’impro comme catalyseur des passions des participants!&nbsp;<br><br>22h00 Scène ouverte&nbsp;<br><br>A la fin de l’atelier, chaque participant sera invité à restituer sa création... Une scène ouverte, c’est déjà du cabaret... Et cet atelier existe aussi pour le rappeler.&nbsp;<br><br>Avec une pratique régulière et un entraînement approprié, une scène ouverte peut se révéler spectaculairement sensationnelle!&nbsp;<br><br>Et puisqu’elle est ouverte, elle est ouverte à tous, à tous, tous , TOUS !&nbsp;<br><br>TOUS...&nbsp;<br><br>Les inscriptions se font après le théâtre d’impro!&nbsp;<br><br>A travers l’atelier réalité café-théâtre, vous êtes invités à monter un véritable café-théâtre tout au long de la saison 2017-2018&nbsp;<br><br>Pour les plus courageux&nbsp;<br>Une restitution de l’atelier sera programmé en mai</p>\n<!-- /wp:paragraph -->','L\'Atelier Réalité : Scène Ouverte','','publish','closed','closed','','latelier-realite-scene-ouverte','','','2019-04-15 19:19:00','2019-04-15 17:19:00','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=67',0,'culture','',0),(68,1,'2019-04-08 14:03:14','2019-04-08 12:03:14','','florida-state-university-westcott-building-auditorium-interior-69815','','inherit','open','closed','','florida-state-university-westcott-building-auditorium-interior-69815','','','2019-04-08 14:03:14','2019-04-08 12:03:14','',67,'http://localhost/P2v2.2/wp-content/uploads/2019/04/florida-state-university-westcott-building-auditorium-interior-69815.jpeg',0,'attachment','image/jpeg',0),(69,1,'2019-04-08 14:07:56','2019-04-08 12:07:56','<!-- wp:paragraph -->\n<p>Venez jouer, rencontrer et échanger avec les créateurs locaux de jeux vidéo indépendants !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le format est simple trois développeurs locaux présentent les coulisses de leur jeu vidéo en cours de production. Puis, c’est à vous de prendre les manettes pour tester les jeux présentés et échanger en tête-à-tête avec les développeurs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En parallèle, le Festival Européen du Film Fantastique de Strasbourg vous propose une sélection de trois jeux indépendants multijoueurs, en accès libre tout au long de la soirée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Proposé part le Festival Européen du Film Fantastique de Strasbourg, East Games, le FabCafé et le Shadok.</p>\n<!-- /wp:paragraph -->','France - Danemark','','trash','closed','closed','','france-danemark__trashed','','','2019-04-08 14:12:11','2019-04-08 12:12:11','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=69',0,'sport','',0),(70,1,'2019-04-08 14:07:42','2019-04-08 12:07:42','','event_indie-game-night-6_848486','','inherit','open','closed','','event_indie-game-night-6_848486','','','2019-04-08 14:07:42','2019-04-08 12:07:42','',69,'http://localhost/P2v2.2/wp-content/uploads/2019/04/event_indie-game-night-6_848486.jpg',0,'attachment','image/jpeg',0),(71,0,'2019-04-08 14:11:51','2019-04-08 12:11:51','<!-- wp:paragraph -->\n<p> Venez jouer, rencontrer et échanger avec les créateurs locaux de jeux vidéo indépendants ! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> Le format est simple trois développeurs locaux présentent les coulisses de leur jeu vidéo en cours de production. Puis, c’est à vous de prendre les manettes pour tester les jeux présentés et échanger en tête-à-tête avec les développeurs. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> En parallèle, le Festival Européen du Film Fantastique de Strasbourg vous propose une sélection de trois jeux indépendants multijoueurs, en accès libre tout au long de la soirée. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> Proposé part le Festival Européen du Film Fantastique de Strasbourg, East Games, le FabCafé et le Shadok.  </p>\n<!-- /wp:paragraph -->','Indie Game Night','','publish','closed','closed','','indie-game-night','','','2019-04-15 19:18:48','2019-04-15 17:18:48','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=71',0,'culture','',0),(72,1,'2019-04-08 14:13:18','2019-04-08 12:13:18','<!-- wp:paragraph -->\n<p>\n\nDans le cadre du Pacte pour la démocratie à Strasbourg, les strasbourgeois sont invités à choisir les projets retenus, jusqu’au 30 avril.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour la première fois cette année, un million d’euros du budget d’investissement de la Ville de Strasbourg sera dédié à des projets proposés par des citoyens.<br>Parmi les plus de 200 déposés fin 2018, une soixantaine de projets, répartis sur les dix quartiers de la ville, a été jugée faisable. Ces projets sont désormais soumis au vote des Strasbourgeois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Jusqu’au 30 avril, chaque citoyen est invité à se rendre sur la plateforme de participation citoyenne : participer.strasbourg.eu. Après avoir pris connaissance de l’ensemble des projets, il sera possible d’effectuer 5 votes, soit pour un seul et même projet, soit pour des projets différents.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En fonction des votes, et dans une répartition équitable par quartiers, le montant alloué au budget participatif sera attribué aux projets lauréats. Ceux-ci seront connus au mois de mai.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous les projets déposés ainsi que les détails concernant les modalités de fonctionnement du budget participatif sont disponibles sur :&nbsp;<a href=\"http://participer.strasbourg.eu/\" target=\"_blank\" rel=\"noreferrer noopener\">participer.strasbourg.eu</a>.</p>\n<!-- /wp:paragraph -->','BUDGET PARTICIPATIF','','publish','closed','open','','budget-participatif','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=72',0,'post','',0),(73,1,'2019-04-08 14:13:14','2019-04-08 12:13:14','','Capture1','','inherit','open','closed','','capture1','','','2019-04-08 14:13:14','2019-04-08 12:13:14','',72,'http://localhost/P2v2.2/wp-content/uploads/2019/04/Capture1.png',0,'attachment','image/png',0),(74,1,'2019-04-08 14:13:18','2019-04-08 12:13:18','<!-- wp:paragraph -->\n<p>\n\nDans le cadre du Pacte pour la démocratie à Strasbourg, les strasbourgeois sont invités à choisir les projets retenus, jusqu’au 30 avril.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour la première fois cette année, un million d’euros du budget d’investissement de la Ville de Strasbourg sera dédié à des projets proposés par des citoyens.<br>Parmi les plus de 200 déposés fin 2018, une soixantaine de projets, répartis sur les dix quartiers de la ville, a été jugée faisable. Ces projets sont désormais soumis au vote des Strasbourgeois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Jusqu’au 30 avril, chaque citoyen est invité à se rendre sur la plateforme de participation citoyenne : participer.strasbourg.eu. Après avoir pris connaissance de l’ensemble des projets, il sera possible d’effectuer 5 votes, soit pour un seul et même projet, soit pour des projets différents.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En fonction des votes, et dans une répartition équitable par quartiers, le montant alloué au budget participatif sera attribué aux projets lauréats. Ceux-ci seront connus au mois de mai.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous les projets déposés ainsi que les détails concernant les modalités de fonctionnement du budget participatif sont disponibles sur :&nbsp;<a href=\"http://participer.strasbourg.eu/\" target=\"_blank\" rel=\"noreferrer noopener\">participer.strasbourg.eu</a>.</p>\n<!-- /wp:paragraph -->','BUDGET PARTICIPATIF','','inherit','closed','closed','','72-revision-v1','','','2019-04-08 14:13:18','2019-04-08 12:13:18','',72,'http://localhost/P2v2.2/2019/04/08/72-revision-v1/',0,'revision','',0),(75,0,'2019-04-08 14:15:16','2019-04-08 12:15:16','<!-- wp:paragraph -->\n<p>\n\nDans le cadre du renouvellement urbain et après un an de concertation, la Ville de Strasbourg a inauguré la 1ère aire de Parkour à Hautepierre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le Parkour consiste à courir, sauter et grimper sur différents obstacles et agrès en utilisant ses seules capacités motrices. Une pratique ludique et créative née en France et qui a déjà fait des adeptes dans le monde entier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Que les habitants du quartier de Hautepierre s’approprient le lieu comme un site d’entrainement convivial mais aussi de rencontre et de partage entre passionnés de la discipline, c’est le souhait de Sacha Lemaire, président de l’association sportive PK Stras créée en 2010 qui se félicite de ce nouvel équipement&nbsp;:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>«&nbsp;Je suis heureux que ce projet, plébiscité par les enfants de Hautepierre, ait pu voir le jour. Nous avons beaucoup échangé avec les différents services de la ville pendant la phase de conception. Comme il s’agissait du premier projet de ce type, il y a eu quelques obstacles administratifs à appréhender. Mais les équipes de la ville ont fait un super travail. Le résultat est plutôt réussi. Les hauteurs sont accessibles pour les plus petits et l’ensemble laisse libre cours à la créativité du pratiquant débutant et expérimenté. C’est très bien pensé&nbsp;! Nous avons proposé à la ville d’animer la structure et d’y faire des initiations, en parallèle des cours que nous donnons déjà en indoor à la salle Karine et des entraînements à l’extérieur&nbsp;».</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>ENCOURAGER LES JEUNES TALENTS ISSUS DE HAUTEPIERRE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>«&nbsp;Nous nous proposons ici comme passeurs afin de donner les bons réflexes aux débutants sur les aspects sportifs mais aussi sécurité, respect des lieux et cohabitation harmonieuse avec les habitants.&nbsp;»</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce nouvel équipement fait l’unanimité notamment auprès des élèves de l’école élémentaire Karine et des enfants du quartier. Depuis son inauguration en novembre dernier, des groupes d’enfants du quartier (8-14 ans) s’y entraînent régulièrement après l’école et le weekend.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On commence à y voir des habitués qui progressent doucement. L’association PK Stras s’y entraîne aussi à l’occasion en soirée quand il y a moins de monde. La fréquentation devrait augmenter considérablement avec l’arrivée des beaux jours.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>UN ENCADREMENT POUR S’INITIER À LA PRATIQUE DU PARKOUR</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Depuis son ouverture, les encadrants de l’association PK Stras ainsi que des bénévoles s’y entraînent de temps en temps et donnent des conseils gratuits à ceux qui le demandent.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Au printemps, PK Stras proposera des créneaux d’initiation avec les associations du quartier.</li><li>Des stages d’initiation seront organisés pendant les vacances scolaires, accessibles à partir de 10 ans. Les plus motivés trouveront dans l’association un endroit pour s’entraîner avec d’autres passionnés.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2>QUELS SONT LES OBJECTIFS DE L’ASSOCIATION PK STRAS À PLUS OU MOINS COURT TERME&nbsp;?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>L’association refuse du monde chaque année. Elle grandit à un rythme mesuré afin de garder un encadrement de qualité et une ambiance familiale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>«&nbsp;Notre prochain rêve serait d’ouvrir notre propre salle dédiée à la pratique dans un hangar ou une friche industrielle réhabilitée. Elle permettrait de s’affranchir des créneaux des salles de sport de la ville et de pouvoir accueillir des publics plus variés, notamment les groupes scolaires qui sont très demandeurs, et d’y développer des projets culturels et artistiques. Nous sommes bien sûr également ouverts pour aider la ville dans ses réflexions sur l’aménagement d’autres éléments de mobilier urbain. Les nouveaux quartiers poussent comme des champignons et l’aménagement des lieux de vie en bas des tours sont autant d’opportunités de créer des espaces ludiques autour des nouvelles pratiques urbaines&nbsp;», confie le président.</p>\n<!-- /wp:paragraph -->','Nouvel équipement à Hautepierre : Aire de Parkour','','publish','closed','closed','','nouvel-equipement-sportif-a-hautepierre-la-1ere-aire-de-parkour-fait-lunanimite','','','2019-04-15 19:16:31','2019-04-15 17:16:31','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=75',0,'sport','',0),(76,1,'2019-04-08 14:14:56','2019-04-08 12:14:56','','actu-3-parkour','','inherit','open','closed','','actu-3-parkour','','','2019-04-08 14:14:56','2019-04-08 12:14:56','',75,'http://localhost/P2v2.2/wp-content/uploads/2019/04/actu-3-parkour.jpg',0,'attachment','image/jpeg',0),(77,0,'2019-04-08 14:18:51','2019-04-08 12:18:51','<!-- wp:paragraph -->\n<p> Les joueuses de Corinne Diacre comptent sur votre soutien lundi 8 avril à 21h00 au stade de la Meinau. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A 2 mois de la Coupe du monde féminine de la FIFA qui se déroulera en France du 7 juin au 7 juillet, l’équipe de France féminine rencontre la sélection danoise, finaliste du dernier Euro (2017) pour un match amical à Strasbourg.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce match de préparation pour la Coupe du Monde est le premier dans la capitale alsacienne depuis février 2013, où les Françaises avaient tenu en échec les Allemandes sur le score de 3-3.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce sera également l’un des derniers matchs amicaux pour les Bleues avant le début du Mondial.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Réservez vos places sur&nbsp;<a href=\"http://billetterie.fff.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">billetterie.fff.fr</a>.</p>\n<!-- /wp:paragraph -->','France-Danemark au stade de la Meinau','','publish','closed','closed','','france-danemark-au-stade-de-la-meinau','','','2019-04-15 19:16:19','2019-04-15 17:16:19','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=77',0,'sport','',0),(78,1,'2019-04-08 14:18:41','2019-04-08 12:18:41','','Football-Fra_Dan_RS','','inherit','open','closed','','football-fra_dan_rs','','','2019-04-08 14:18:41','2019-04-08 12:18:41','',77,'http://localhost/P2v2.2/wp-content/uploads/2019/04/Football-Fra_Dan_RS.jpg',0,'attachment','image/jpeg',0),(79,0,'2019-04-08 14:21:46','2019-04-08 12:21:46','<!-- wp:paragraph -->\n<p> Dans le cadre de sa démarche Sport santé, l’Office des Sports de Strasbourg organise des animations sportives gratuites dans le parc du Heyritz dimanche 14 avril. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le dimanche 14 avril, l’Office des Sports et ses clubs partenaires proposent au public la découverte du sport par des initiations ciblées :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Découverte de l’aviron : Rowing Club Strasbourg</li><li>Initiation au rameur : Rowing Club Strasbourg</li><li>Initiation à la gymnastique : Gym Concordia Neudorf</li><li>Initiation au badminton : CEBA</li><li>Initiation au teqball : Teqball Strasbourg Eurométropole&nbsp;</li><li>Initiation au karaté : Ecole de Karaté Strasbourg</li><li>Initiation au taekwondo : Taekwondo Strasbourg</li><li>Initiation à la boxe : Allez les Filles&nbsp;</li><li>Initiation au muay thaï : Apsara Muay Strasbourg</li><li>Circuit en handi-fauteuil : ASHPA</li><li>Initiation à la marche nordique : ASN 67&nbsp;</li><li>Utilisation des agrès avec un coach et découverte du circuit training : KEEP COOL &nbsp;</li><li>Informations sur l’offre sportive strasbourgeoise : ODS</li><li>Informations sur les Courses de Strasbourg Europe : ACSE</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;<br>Tirage au sort de bons d’essais gratuits et de goodies, buvette…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Alors,&nbsp;<strong>enfilez vos baskets et venez bouger au parc du Heyritz</strong>&nbsp;dimanche 14 avril de 14h00 à 18h00 (à proximité du Rowing Club)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Prochaines&nbsp;animations sportives gratuites</strong>&nbsp;:<br><strong>Dimanche 28 avril</strong>&nbsp;de 14h00 à 18h00 : p<strong>arc de la Citadelle</strong>&nbsp;(à proximité des agrès - rue d’Ankara)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>L’organisateur se réserve le droit d’annuler la manifestation en cas de pluie.</em><br><a href=\"http://www.ods67.com%20/\" target=\"_blank\" rel=\"noreferrer noopener\">www.ods67.com&nbsp;</a></p>\n<!-- /wp:paragraph -->','Ça bouge aux parcs','','publish','closed','closed','','ca-bouge-aux-parcs','','','2019-04-15 19:17:10','2019-04-15 17:17:10','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=79',0,'sport','',0),(80,1,'2019-04-08 14:21:30','2019-04-08 12:21:30','','BougeParc','','inherit','open','closed','','bougeparc','','','2019-04-08 14:21:30','2019-04-08 12:21:30','',79,'http://localhost/P2v2.2/wp-content/uploads/2019/04/BougeParc.jpg',0,'attachment','image/jpeg',0),(81,1,'2019-04-08 14:23:42','2019-04-08 12:23:42','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:4:\"page\";s:8:\"operator\";s:2:\"==\";s:5:\"va