>\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Contact','','inherit','closed','closed','','12-autosave-v1','','','2019-04-15 18:28:04','2019-04-15 16:28:04','',12,'http://localhost/P2v2.2/2019/04/15/12-autosave-v1/',0,'revision','',0),(121,1,'2019-04-15 18:07:19','2019-04-15 16:07:19','<!-- wp:paragraph -->\n<p> <br>Il est parfois difficile d’accéder à des informations simples en matière de santé. Pour y voir plus clair, venez à la 7e édition du Printemps de la santé, du 8 au 18 avril au Neuhof </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://www.strasbourg.eu/documents/976405/4365416/Leprintempssant%C3%A9neuhofavril2019.jpg/ebe080f3-7c7a-729c-94a3-809a33829a7b?t=1554902446406\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Le Printemps de la santé, c\'est un moment pour parler de la santé autrement, vous informer et bénéficier de conseils dans vos démarches santé. C’est aussi aborder la santé positivement avec des animations autour de l’alimentation, de la santé bucco-dentaire, des jeux et des activités physiques et ludiques !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.strasbourg.eu/documents/976405/4365416/Flyer_PrintempsSante_2019.pdf/cc680d87-6c61-6705-9ee2-5069e41c833c\" target=\"_blank\" rel=\"noreferrer noopener\">Consultez le programme du \"printemps de la santé\"</a>&nbsp;qui se déroule du 8 au 18 avril dans tout le quartier du Neuhof, au marché, à l’association La RESU et à l’espace culturel Django Reinhardt.<br>&nbsp;</p>\n<!-- /wp:paragraph -->','C’EST LE PRINTEMPS DE LA SANTÉ AU NEUHOF','','publish','closed','open','','cest-le-printemps-de-la-sante-au-neuhof','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=121',0,'post','',0),(122,1,'2019-04-15 18:07:12','2019-04-15 16:07:12','','Leprintempssanténeuhofavril2019','','inherit','open','closed','','leprintempssanteneuhofavril2019','','','2019-04-15 18:07:12','2019-04-15 16:07:12','',121,'http://localhost/P2v2.2/wp-content/uploads/2019/04/Leprintempssanténeuhofavril2019.jpg',0,'attachment','image/jpeg',0),(123,1,'2019-04-15 18:07:19','2019-04-15 16:07:19','<!-- wp:paragraph -->\n<p> <br>Il est parfois difficile d’accéder à des informations simples en matière de santé. Pour y voir plus clair, venez à la 7e édition du Printemps de la santé, du 8 au 18 avril au Neuhof </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://www.strasbourg.eu/documents/976405/4365416/Leprintempssant%C3%A9neuhofavril2019.jpg/ebe080f3-7c7a-729c-94a3-809a33829a7b?t=1554902446406\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Le Printemps de la santé, c\'est un moment pour parler de la santé autrement, vous informer et bénéficier de conseils dans vos démarches santé. C’est aussi aborder la santé positivement avec des animations autour de l’alimentation, de la santé bucco-dentaire, des jeux et des activités physiques et ludiques !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.strasbourg.eu/documents/976405/4365416/Flyer_PrintempsSante_2019.pdf/cc680d87-6c61-6705-9ee2-5069e41c833c\" target=\"_blank\" rel=\"noreferrer noopener\">Consultez le programme du \"printemps de la santé\"</a>&nbsp;qui se déroule du 8 au 18 avril dans tout le quartier du Neuhof, au marché, à l’association La RESU et à l’espace culturel Django Reinhardt.<br>&nbsp;</p>\n<!-- /wp:paragraph -->','C’EST LE PRINTEMPS DE LA SANTÉ AU NEUHOF','','inherit','closed','closed','','121-revision-v1','','','2019-04-15 18:07:19','2019-04-15 16:07:19','',121,'http://localhost/P2v2.2/2019/04/15/121-revision-v1/',0,'revision','',0),(124,1,'2019-04-15 18:08:22','2019-04-15 16:08:22','<!-- wp:paragraph -->\n<p>\n\nQuinze jours après sa commande chez Alstom pour la ligne H, la CTS choisit l’alsacien Dietrich Carebus Group (DCG) pour équiper la ligne 10 de douze véhicules.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://www.strasbourg.eu/documents/976405/4193722/CTS+bus+%C3%A9lectriques%C2%A9DCG.jpg/8dd4b5a0-9fff-07ec-1e84-dd4667900579?t=1554110297253\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Strasbourg est la première ville au monde à acquérir le dernier modèle de bus électrique de DCG. Le véhicule de douze mètres de long fera le tour de la Grande-Ile, en passant par la gare, les boulevards et les quais, le 15 septembre prochain pour des tests. Le reste de la flotte de douze véhicules sera livré mi-octobre pour une mise en service officielle en novembre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour conduire ces nouveaux bus, la CTS prévoit de former 150 conducteurs. Des agents basés au dépôt de l’Elsau, déjà équipé de bornes pour recharger les véhicules.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>D’une capacité de 91 places (24 assises et 2 à mobilité réduite), les douze bus électriques ne font aucun bruit et surtout ne polluent pas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>\"Cette commande témoigne de la volonté de la CTS de participer à la décarbonation de notre territoire mais aussi d’agir en faveur du confort de nos usagers et des riverains de la ligne grâce à la diminution des nuisances sonores\"</em>, souligne Alain Fontanel, président de la CTS.</p>\n<!-- /wp:paragraph -->','LA CTS PREND LE VIRAGE DE L’ÉLECTRIQUE','','publish','closed','open','','la-cts-prend-le-virage-de-lelectrique','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=124',0,'post','',0),(125,1,'2019-04-15 18:08:07','2019-04-15 16:08:07','','CTS bus électriques DCG','','inherit','open','closed','','cts-bus-electriquesdcg','','','2019-04-24 11:36:58','2019-04-24 09:36:58','',124,'http://localhost/P2v2.2/wp-content/uploads/2019/04/CTS-bus-électriques©DCG.jpg',0,'attachment','image/jpeg',0),(126,1,'2019-04-15 18:08:22','2019-04-15 16:08:22','<!-- wp:paragraph -->\n<p>\n\nQuinze jours après sa commande chez Alstom pour la ligne H, la CTS choisit l’alsacien Dietrich Carebus Group (DCG) pour équiper la ligne 10 de douze véhicules.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img src=\"https://www.strasbourg.eu/documents/976405/4193722/CTS+bus+%C3%A9lectriques%C2%A9DCG.jpg/8dd4b5a0-9fff-07ec-1e84-dd4667900579?t=1554110297253\" alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Strasbourg est la première ville au monde à acquérir le dernier modèle de bus électrique de DCG. Le véhicule de douze mètres de long fera le tour de la Grande-Ile, en passant par la gare, les boulevards et les quais, le 15 septembre prochain pour des tests. Le reste de la flotte de douze véhicules sera livré mi-octobre pour une mise en service officielle en novembre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour conduire ces nouveaux bus, la CTS prévoit de former 150 conducteurs. Des agents basés au dépôt de l’Elsau, déjà équipé de bornes pour recharger les véhicules.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>D’une capacité de 91 places (24 assises et 2 à mobilité réduite), les douze bus électriques ne font aucun bruit et surtout ne polluent pas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>\"Cette commande témoigne de la volonté de la CTS de participer à la décarbonation de notre territoire mais aussi d’agir en faveur du confort de nos usagers et des riverains de la ligne grâce à la diminution des nuisances sonores\"</em>, souligne Alain Fontanel, président de la CTS.</p>\n<!-- /wp:paragraph -->','LA CTS PREND LE VIRAGE DE L’ÉLECTRIQUE','','inherit','closed','closed','','124-revision-v1','','','2019-04-15 18:08:22','2019-04-15 16:08:22','',124,'http://localhost/P2v2.2/2019/04/15/124-revision-v1/',0,'revision','',0),(127,1,'2019-04-15 18:11:12','2019-04-15 16:11:12','','lufthansa_DJE3107@JDorkel','','inherit','open','closed','','lufthansa_dje3107jdorkel','','','2019-04-15 18:11:12','2019-04-15 16:11:12','',1,'http://localhost/P2v2.2/wp-content/uploads/2019/04/lufthansa_DJE3107@JDorkel.jpg',0,'attachment','image/jpeg',0),(128,1,'2019-04-15 18:11:18','2019-04-15 16:11:18','<!-- wp:paragraph -->\n<p>\n\nLa compagnie allemande Lufthansa ouvrira une nouvelle liaison aérienne entre Strasbourg et Munich à partir du 9 avril prochain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans un premier temps, la desserte s\'élèvera à cinq allers-retours par semaine (un par jour sauf le week-end). L\'avion sera un Bombardier CRJ900 de 90 sièges et les vols dureront 55 minutes. Lufthansa annonce des allers-retours à 99 euros et des allers simples à 79 euros (prix les plus bas).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Il y a trois ans, le groupe de contact mis en place par le Parlement, la Ville et l\'Eurométropole a fait état de difficultés pour les députés des pays de l\'Est de se rendre à Strasbourg, explique le directeur de l\'aéroport Thomas Dubus. Si les horaires de vols sont calés en fonction des obligations diplomatiques, l\'offre commerciale s\'adresse à tout le monde.\" Strasbourg possède 52 liaisons directes, la desserte de Munich remplaçant celle de Prague dont l\'activité fléchissait depuis quelques années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avec 140 destinations dans 46 pays (Europe, Amérique, Asie, Moyen Orient et Afrique), la capitale bavaroise est la deuxième plate-forme de correspondance de Lufthansa (après Francfort), avec un taux de croissance annuel de 5 % à 10 %.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"La liaison vers Munich existait entre 2005 et 2007 mais il y avait alors beaucoup moins de destinations en correspondance, assure Michael Gloor, directeur de Lufthansa France. Nous espérons que cela aura un impact sur le tourisme en Alsace. En tant que capitale européenne, Strasbourg dispose d\'une forte notoriété auprès des Allemands.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>L\'engagement entre l\'aéroport de Strasbourg et la compagnie allemande s\'établit sur une durée de trois ans. \"La desserte hebdomadaire augmentera au fur et à mesure, passant à 6 puis 7 allers-retours\", révèle Thomas Dubus.</p>\n<!-- /wp:paragraph -->','LA BAVIÈRE PAR LES AIRS','','inherit','closed','closed','','1-revision-v1','','','2019-04-15 18:11:18','2019-04-15 16:11:18','',1,'http://localhost/P2v2.2/2019/04/15/1-revision-v1/',0,'revision','',0),(129,1,'2019-04-15 18:12:49','2019-04-15 16:12:49','<!-- wp:paragraph -->\n<p>\n\nPour encourager les Strasbourgeois à faire vivre leur balcon ou leur jardin, la Ville et le FabLab proposent des ateliers pour apprendre à fabriquer du matériel dans le cadre de l\'opération Strasbourg ça pousse. Le samedi 30 mars, les jardinières suspendues étaient au menu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si ce n\'était pour le papier de verre qui jonche la table et la poussière de bois sur leurs vêtements, on pourrait croire que la poignée de trentenaire attablés devant le Shadok, ce samedi 30 mars, profite simplement des premiers rayons de soleil du printemps. Mais ils font encore mieux : ils se préparent à la belle saison en fabriquant une jardinière suspendue pour leur balcon.&nbsp;<br>L\'atelier, gratuit et ouvert aux novices, est proposé par la Ville dans le cadre de&nbsp;<a href=\"http://www.strasbourgcapousse.eu/\" target=\"_blank\" rel=\"noreferrer noopener\">\"Strasbourg ça pousse\"</a>. Le collectif AV.Lab, qui gère le FabLab installé au Shadok, l\'organise et l\'anime.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>PONCER, MONTER, PLANTER</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><em>\"Je m\'intéresse au mouvement DIY (\"Do it yourself\", soit \"fabrication maison\") et j\'avais envie de m\'initier au maniement de nouvelles machines\"</em>, confie Johanna, une participante.&nbsp;<br>En début d\'après-midi, comme les cinq autres bricoleurs du jour, elle a pu faire son baptême de fraiseuse numérique. Rodrigo Morales Pomarat, designer et co-fondateur du FabLab, a conçu un modèle de jardinière dont il a mis le fichier numérique à disposition des participants, avant de les guider dans la réalisation de l\'objet.&nbsp;<br><em>\"J\'ai décidé d\'adapter ce fichier pour obtenir une jardinière plus grande, capable d\'accueillir deux pots ou un petit bac\"</em>, explique Alexandre.<br>Une fois les différentes pièces de bois soigneusement poncées à la main, il faut passer à l\'étape délicate de l\'assemblage.&nbsp;<em>\"Le modèle fonctionne sur un principe de montage uniquement avec des mortaises et des tenons, à la japonaise\"</em>, précise Rodrigo Morales Pomarat. Pour compenser de petits écarts liés à l\'usinage des pièces, plusieurs jardiniers ont tout de même recours à la colle à bois.&nbsp;<br>Il ne reste plus alors qu\'à vitrifier les jardinières.<em>&nbsp;\"Elle ira très bien sur ma terrasse\"</em>, se réjouit Hélène, qui fait pousser sur ses 10 m<sup>2</sup>&nbsp;de surfaces extérieures aromates, tomates, fraises, mais aussi épinards, rhubarbe, framboises, salades, sans oublier quelques fleurs...&nbsp;</p>\n<!-- /wp:paragraph -->','DE LA FRAISEUSE AUX FRAISIERS','','publish','closed','closed','','de-la-fraiseuse-aux-fraisiers','','','2019-04-19 14:57:54','2019-04-19 12:57:54','',0,'http://localhost/P2v2.2/?p=129',0,'post','',0),(130,1,'2019-04-15 18:12:40','2019-04-15 16:12:40','','SCP_DSC8317@PStirnweiss','','inherit','open','closed','','scp_dsc8317pstirnweiss','','','2019-04-15 18:12:40','2019-04-15 16:12:40','',129,'http://localhost/P2v2.2/wp-content/uploads/2019/04/SCP_DSC8317@PStirnweiss.jpg',0,'attachment','image/jpeg',0),(131,1,'2019-04-15 18:12:49','2019-04-15 16:12:49','<!-- wp:paragraph -->\n<p>\n\nPour encourager les Strasbourgeois à faire vivre leur balcon ou leur jardin, la Ville et le FabLab proposent des ateliers pour apprendre à fabriquer du matériel dans le cadre de l\'opération Strasbourg ça pousse. Le samedi 30 mars, les jardinières suspendues étaient au menu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si ce n\'était pour le papier de verre qui jonche la table et la poussière de bois sur leurs vêtements, on pourrait croire que la poignée de trentenaire attablés devant le Shadok, ce samedi 30 mars, profite simplement des premiers rayons de soleil du printemps. Mais ils font encore mieux : ils se préparent à la belle saison en fabriquant une jardinière suspendue pour leur balcon.&nbsp;<br>L\'atelier, gratuit et ouvert aux novices, est proposé par la Ville dans le cadre de&nbsp;<a href=\"http://www.strasbourgcapousse.eu/\" target=\"_blank\" rel=\"noreferrer noopener\">\"Strasbourg ça pousse\"</a>. Le collectif AV.Lab, qui gère le FabLab installé au Shadok, l\'organise et l\'anime.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>PONCER, MONTER, PLANTER</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><em>\"Je m\'intéresse au mouvement DIY (\"Do it yourself\", soit \"fabrication maison\") et j\'avais envie de m\'initier au maniement de nouvelles machines\"</em>, confie Johanna, une participante.&nbsp;<br>En début d\'après-midi, comme les cinq autres bricoleurs du jour, elle a pu faire son baptême de fraiseuse numérique. Rodrigo Morales Pomarat, designer et co-fondateur du FabLab, a conçu un modèle de jardinière dont il a mis le fichier numérique à disposition des participants, avant de les guider dans la réalisation de l\'objet.&nbsp;<br><em>\"J\'ai décidé d\'adapter ce fichier pour obtenir une jardinière plus grande, capable d\'accueillir deux pots ou un petit bac\"</em>, explique Alexandre.<br>Une fois les différentes pièces de bois soigneusement poncées à la main, il faut passer à l\'étape délicate de l\'assemblage.&nbsp;<em>\"Le modèle fonctionne sur un principe de montage uniquement avec des mortaises et des tenons, à la japonaise\"</em>, précise Rodrigo Morales Pomarat. Pour compenser de petits écarts liés à l\'usinage des pièces, plusieurs jardiniers ont tout de même recours à la colle à bois.&nbsp;<br>Il ne reste plus alors qu\'à vitrifier les jardinières.<em>&nbsp;\"Elle ira très bien sur ma terrasse\"</em>, se réjouit Hélène, qui fait pousser sur ses 10 m<sup>2</sup>&nbsp;de surfaces extérieures aromates, tomates, fraises, mais aussi épinards, rhubarbe, framboises, salades, sans oublier quelques fleurs...&nbsp;</p>\n<!-- /wp:paragraph -->','DE LA FRAISEUSE AUX FRAISIERS','','inherit','closed','closed','','129-revision-v1','','','2019-04-15 18:12:49','2019-04-15 16:12:49','',129,'http://localhost/P2v2.2/2019/04/15/129-revision-v1/',0,'revision','',0),(132,0,'2019-04-15 18:17:12','2019-04-15 16:17:12','<!-- wp:paragraph -->\n<p>\n\nLa plus grande œuvre d’art de Strasbourg sera inaugurée mercredi 3 avril en présence du street-artiste Astro.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La toile fait quinze mètres de large et dix étages de haut : il s’agit de la façade de la résidence universitaire Les Flamboyants à l’Esplanade. Cette œuvre immense est l’une des plus grandes réalisée par Astro, graffeur parisien et mondialement connu. Le vernissage a lieu ce mercredi à 18h30 au pied de la résidence.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Installé au beau milieu des tours de béton gris, Astro a décidé de ramener de la couleur et de la clarté dans le quartier. \"Je suis parti de ma couleur préférée, le turquoise, pour aller vers le jaune. J’ai choisi de mettre du blanc aussi parce qu’il y a pas mal de bâtiments et on se sent enfermé. Je voulais ramener de la lumière et de l’espoir\", explique l’artiste.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Adepte des formes géométriques et des illusions d’optiques, Astro a choisi un emboîtement de rectangles habillés par des arabesques qui amènent de la rondeur à son œuvre.<br>Il aura fallu une quarantaine de litres de peinture et environ la même quantité de bombes pour exécuter cette fresque démesurée, débutée le 24 mars.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette œuvre pourrait donner des idées pour l’avenir. Pourquoi ne pas voir se colorer chaque année des façades sur le territoire de la Ville et de l’Eurométropole. \"Je trouve que c’est une excellente idée. J’encourage les collectivités à faire de la place aux street-artistes et à leur laisser un espace pour exprimer leur art plutôt que de les contraindre à graffer dans l’illégalité\", précise Astro.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette œuvre géante, réalisée dans le cadre du Off du NL Contest, a coûté 13 000 euros. Le financement a été pris en charger par le Crous et l’Eurométropole de Strasbourg dans le cadre de l’opération Strasbourg aime ses étudiants.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Désormais, Strasbourg est l’une des rares villes en France où l’artiste a exposé son talent en grand sur les murs. Dans quelques temps, Astro donnera des couleurs à Metz et à Decazeville.</p>\n<!-- /wp:paragraph -->','ASTRO FAIT SON SHOW À L’ESPLANADE','','publish','closed','closed','','astro-fait-son-show-a-lesplanade','','','2019-04-15 19:17:54','2019-04-15 17:17:54','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=132',0,'culture','',0),(133,1,'2019-04-15 18:16:28','2019-04-15 16:16:28','','Astro street art @Alban Hefti','','inherit','open','closed','','astro-street-art-alban-hefti','','','2019-04-15 18:16:28','2019-04-15 16:16:28','',132,'http://localhost/P2v2.2/wp-content/uploads/2019/04/Astro-street-art-@Alban-Hefti.jpg',0,'attachment','image/jpeg',0),(134,0,'2019-04-15 18:18:40','2019-04-15 16:18:40','<!-- wp:paragraph -->\n<p>\n\nForme ton équipe de 3 joueurs + 1 remplaçant et participe au tournoi mercredi 17 avril à partir de 13h30 au parc de la Bergerie à Strasbourg-Cronenbourg.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Le challenge basket Batigère est de retour</strong>&nbsp;cette année à Strasbourg avec des nouveautés.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quel que soit ton âge et ton niveau de pratique, si tu aimes le basket, ce tournoi est pour toi. Il est gratuit, ouvert à tous et de nombreux cadeaux sont à gagner.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Plusieurs animations seront proposées autour du terrain.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Des joueurs de la SIG Strasbourg seront également présents au cours de l’après-midi.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Inscription gratuite sur place le jour même.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Final samedi 27 avril à Nancy</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Plus d’info sur la page facebook : challenge batigere<br>Contact et renseignements auprès de&nbsp;<a href=\"mailto:christelle.lecomte@batigere.fr\">Christelle Lecomte</a>&nbsp;ou par téléphone au 06 47 36 17 15&nbsp;</p>\n<!-- /wp:paragraph -->','GRAND TOURNOI DE BASKET','','publish','closed','closed','','grand-tournoi-de-basket','','','2019-04-15 19:17:04','2019-04-15 17:17:04','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=134',0,'sport','',0),(135,1,'2019-04-15 18:18:31','2019-04-15 16:18:31','','challenge-batigere-2019','','inherit','open','closed','','challenge-batigere-2019','','','2019-04-15 18:18:31','2019-04-15 16:18:31','',134,'http://localhost/P2v2.2/wp-content/uploads/2019/04/challenge-batigere-2019.jpg',0,'attachment','image/jpeg',0),(136,0,'2019-04-15 18:20:04','2019-04-15 16:20:04','<!-- wp:paragraph -->\n<p>\n\nPremière édition de l\'Open international de Strasbourg les 27 et 28 avril au gymnase de la Rotonde, rue Pierre Nuss, de 8h00 à 17h00.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>L\'Eurométropole Strasbourg Taekwondo (ESTKD) en collaboration avec la ligue Grand Est de Taekwondo organisent la première édition de l\'Open international de Strasbourg.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cet événement national succèdera au traditionnel Open d\'Alsace.&nbsp;<br>Le club hôte qui compte plus de 700 adhérents et une trentaine de bénévole accueillera cette compétition dans les meilleures conditions possibles au gymnase Rotonde les 27 et 28 avril 2019.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Plusieurs équipes venus de tout l\'hexagone mais aussi d\'Allemagne, Suisse, Luxembourg, Belgique feront le déplacement pour disputer ce tournoi inscrit au calendrier national.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La veille de l\'événement, l\'ESTKD organisera des initiations en directions des écoles et collèges pour faire découvrir cet art martial et sport olympique.&nbsp;<br>Les enfants auront droit à des invitations pour le tournoi et pourront ainsi rencontrer les champions tels que Bouzid Souihli Ismaël, licencié au club de Strasbourg et membre de l\'équipe de France.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Au programme :<br><strong>Samedi 27 avril 2019</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>8h00 - Ouverture du gymnase et présentation des équipes</li><li>9h00 à 18h00 - Compétition Cadets/Juniors/Seniors</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Dimanche 28 avril 2019</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>8h00 - Ouverture du gymnase et présentation des équipes</li><li>9h00 à 17h00 - Compétition Benjamins/Minimes</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Renseignements au 06 50 49 65 23 et sur le site&nbsp;<a href=\"http://www.taekwondograndest.fr/\" target=\"_blank\" rel=\"noreferrer noopener\">www.taekwondograndest.fr</a></p>\n<!-- /wp:paragraph -->','OPEN INTERNATIONAL DE TAEKWONDO','','publish','closed','closed','','open-international-de-taekwondo','','','2019-04-15 19:16:55','2019-04-15 17:16:55','',0,'http://localhost/P2v2.2/?post_type=sport&#038;p=136',0,'sport','',0),(137,1,'2019-04-15 18:19:33','2019-04-15 16:19:33','','Open-Taekwondo-2019','Open Taekwondo Performance Grand Est 2018 - Alsace - Schiltigheim\n\nwww.noyanaltun.com','inherit','open','closed','','open-taekwondo-2019','','','2019-04-15 18:19:33','2019-04-15 16:19:33','',136,'http://localhost/P2v2.2/wp-content/uploads/2019/04/Open-Taekwondo-2019.jpg',0,'attachment','image/jpeg',0),(138,0,'2019-04-15 18:24:44','2019-04-15 16:24:44','<!-- wp:heading {\"level\":3} -->\n<h3>PROCHAINES DATES</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Le 16 avril 2019 : 19h30-22h30</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://www.strasbourg.eu/lieu/-/entity/id/685842\"><strong>LA LAITERIE ARTEFACT PRL</strong>&nbsp;</a><br>13 rue du Hohwald&nbsp;<br>67000 Strasbourg</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>PRÉSENTATION</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Né au Nigéria, Jacob Banks déménage à 13 ans à Birmingham en Angleterre où il&nbsp;investit les open mic pour y faire valoir&nbsp;présence vocale et écriture intimiste.&nbsp; Une soul inspiré par l’Afrique,&nbsp;posée sur un entrelacs de textures - &nbsp;808, nappes synthétiques et autres électroniques harmonies - et adressée aux jeunes&nbsp;générations. Valeur montante au Royaume-Uni, Jacob Banks a retourné Paris cette&nbsp;année&nbsp;et sillonne désormais l’hexagone. Dont acte à La Laiterie.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Son album \"Village\" vient de sortir en novembre 2018.</p>\n<!-- /wp:paragraph -->','JACOB BANKS + GUEST','','publish','closed','closed','','jacob-banks-guest','','','2019-04-15 19:17:42','2019-04-15 17:17:42','',0,'http://localhost/P2v2.2/?post_type=culture&#038;p=138',0,'culture','',0),(139,1,'2019-04-15 18:24:41','2019-04-15 16:24:41','','C1clPv3vf5S._SL1000_','','inherit','open','closed','','c1clpv3vf5s-_sl1000_'